import React from "react";

function Intro() {
  return (
    <div className="Intro">
      <header className="bg-white shadow-md">
        <div className="container mx-auto p-5">
          <h1 className="text-3xl font-bold text-center">My Portfolio</h1>
        </div>
      </header>
    </div>
  );
}

export default Intro;
